import { PieChart } from 'react-minimal-pie-chart';
import React from 'react'

const Pie = () => {
  return (
    <div>
        <PieChart
        data={[
            { title: 'One', value: 10, color: '#E38627' },
            { title: 'Two', value: 15, color: '#C13C37' },
            { title: 'Three', value: 20, color: '#6A2135' },
            { title: 'Fpor', value: 20, color: '#7A2135' },
            ]}
            labelPosition={50}
            
            
           
            radius={50}
            rounded
            startAngle={0}
            viewBoxSize={[100, 100]}

/>;
    </div>
  )
}

export default Pie
